import "./Search.scss";

function SearchItem({data}) {
  return (
    <div className="search_item">
      <img
        className="search_img"
        src="https://tvseriesfinale.com/wp-content/uploads/2020/12/sealteam04.jpg"
        alt="hinh anh"
      />
      <p className="search_name">Quá Nhanh Quá Nguy Hiểm 6</p>
    </div>
  );
}

export default SearchItem;
